def newscreen(w,h,c):
    # start with empty grid
    r =[[c for _w in range(w)] for _h in range(h)]

    if draw_borders:
        # add left/right border
        for y in range(h):
            r[y][0]   = "|"
            r[y][w-1] = "|"

            # add top/bottom border
            for x in range(w):
                r[0][x]   = "-"
                r[h-1][x] = "-"

                # add corners
                r[0][0]     = "o"
                r[h-1][0]   = "o"
                r[0][w-1]   = "o"
                r[h-1][w-1] = "o"

    return r

